import Authorization from './components/authorization/authorization';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const token = localStorage.getItem('token');

  if (!token) {
    return (
      <>
        <Authorization />
      </>
    );
  }

  return (
    <h1>Welcome!</h1>
  );
}

export default App;
